import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { AuthRoutingModule } from './auth-routing.module';
import { LoginComponent } from './login/login.component';

import { ActivationComponent } from '../auth/activation/activation.component';
import { VerificationPendingComponent } from '../auth/verification-pending/verification-pending.component';
import { CreateMasterAdminComponent } from '../auth/create-master-admin/create-master-admin.component';
import { ReactiveFormsModule } from '@angular/forms';



@NgModule({
  declarations: [
    LoginComponent,
    CreateMasterAdminComponent,
    ActivationComponent,
    VerificationPendingComponent
  ],
  imports: [
    CommonModule,
    AuthRoutingModule,
    ReactiveFormsModule
  ]
})
export class AuthModule { }
